import logo from './logo.svg';
import './App.css';

function App() {

  let posts = '강남 고기 맛집';

  return (
    <div className="App">
      <div className="black-nav">
        <div>개발 Blog</div>
      </div>
      <h4> {posts} </h4>
      <img src={logo} />
    </div>
  );
}

export default App;
